import "./App.css";
import axios from "axios";
import { useState, useEffect } from "react";

function App() {
  const [message, setMessage] = useState("");

  useEffect(() => {
    console.log("use");
    const getData = async () => {
      try {
        const res = await axios.post("http://127.0.0.1:3000/api", {
          data: {
            foo: "bar",
          },
        });
        console.log(res);
        setMessage(res.data);
      } catch (e) {
        console.log(e);
      }
    };
    getData();
  }, []);

  return <div className="App"></div>;
}

export default App;
